  const { Cart, setCart } = useContext(Crt);
  return (
    <>
      <div className="main_Nav">
        <Navbar />
      </div>
      <section className="table_main">
      <table>
      <thead>
      <tr>
      <td>Remove</td>
      <td>Image</td>
      <td>Product</td>
      <td>Price</td>
      <td>Quantity</td>
      <td>Subtotal</td>
      </tr>
      </thead>
      <tbody>
      {Cart.map((product)=>
        (<tr>
          <td>:tr</td>
          </tr>
  ))}
  </tbody>
  </table>
  </section>
      <br/>
    </>
  );
}

export default Cartpage;
